        height:'60vh',
        backgroundColor:'white',
        boxShadow:'0px 5px 15px black',
        position:'absolute',
        top:'150px',
        marginRight:'15%',
        marginLeft:'15%', 
  
    }
    return (
        <>
        <div style={box}>

            </div>
        </>
    )
}

export default Signup
